import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import RasberryPi from "./components/RasberryPi";

export default function Navibar() {
  return (
    <Router>
      <List>
        /* ['Rasberry Pi', 
          'Python', 
          'PHP', 
          'Java', 
          'Linux', 
          'JavaScript', 
          '아키바 정보', 
          'micro:bit', 
          '챗봇(ChatBot)' */}
        <ListItem button key='Rasberry Pi' component={Link} to='/RasberryPi'>
          <ListItemText primary='Rasberry Pi' />
        </ListItem>
      </List>
      <Switch>
          <Route path='/RasberryPi' component={RasberryPi}></Route>
      </Switch>
    </Router>
  );
}
